import React from "react";
export default function Practice() {

    const isGoingOut = false;
    const answer = isGoingOut ? 'Yes' : 'No';

    return (
      <div style={{ width: '180px', display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column' }}>
        <h1>Do you feel like going out tonight?</h1>
        <div style={{ background: 'white', color: 'black', width: '100px', height: '100px', borderRadius: '101px', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
            { isGoingOut && <h2>{ answer }</h2> }
        </div>
      </div>
    );
}
